/* Data structure for sparse matrices */
typedef struct spmat{    
   int* jc; // column pointer, size n+1
   int* ir; // row index, size nnz
   DTYPE* pr; // nnz valuse, size nnz
   int n; // columns
   int m; // rows
   int nnz;
} spmat;

void sparseMtVm(spmat* A, double* x, double* y, int newVector, int skipDiagonal)
{
	int i, j, k;
	/* fill y with zeros in case A happens to not have any zero rows */
	if( newVector > 0 ){ for( j=0; j<A->n; j++ ){ y[j] = 0; } }
  
  /* if there are no entries in A, just do nothing */
  if( A->nnz == 0 ) return;
	
	if( skipDiagonal ){
		/* Subtract A'*x */	
		for( j=0; j<A->n; j++ ){
			for( k=A->jc[j]; k < A->jc[j+1]; k++ ){		
				i = A->ir[k];
				y[j] -= i==j? 0 : A->pr[k]*x[i];
			}
		}
	} else {
		/* Subtract A'*x */	
		for( j=0; j<A->n; j++ ){
			for( k=A->jc[j]; k < A->jc[j+1]; k++ ){
				y[j] -= A->pr[k]*x[A->ir[k]];
			}
		}
	}
}

void sparseMV(spmat* A, DTYPE* x, DTYPE* y, int a, int newVector)
{
	int i, j;
	/* fill y with zeros in case A happens to not have any zero rows */
	if( newVector > 0 ){ for( i=0; i<A->m; i++ ){ y[i] = 0; } }
	
  /* if there are no entries in A, just do nothing */
  if( A->nnz == 0 ) return;
  
	if( a > 0 ){
		/* Add A*x */
		for( j=0; j<A->n; j++ ){
			for( i=A->jc[j]; i < A->jc[j+1]; i++ ){
				y[A->ir[i]] += A->pr[i]*x[j];
			}
		}
	} else {
		/* Subtract A*x */
		for( j=0; j<A->n; j++ ){
			for( i=A->jc[j]; i < A->jc[j+1]; i++ ){
				y[A->ir[i]] -= A->pr[i]*x[j];
			}
		}
	}
}

void LDL_lsolve2
(
    int n,		/* L is n-by-n, where n >= 0 */
	DTYPE b [ ],	/* size n. input. right-hand-side */    
    int Lp [ ],	/* input of size n+1, not modified */
    int Li [ ],	/* input of size lnz=Lp[n], not modified */
    DTYPE Lx [ ],	/* input of size lnz=Lp[n], not modified */
	DTYPE x [ ]	/* size n. output. solution to Lx=b */
)
{
    int j, p, p2 ;
	for( j=0; j < n; j++ ){ x[j] = b[j]; }
    for (j = 0 ; j < n ; j++){		
		p2 = Lp [j+1] ;
		for (p = Lp [j] ; p < p2 ; p++){ 
			x [Li [p]] -= Lx [p] * x [j]; 
		}
    }
}

void LDL_dsolve
(
    int n,		/* D is n-by-n, where n >= 0 */
    DTYPE X [ ],	/* size n.  right-hand-side on input, soln. on output */
    DTYPE D [ ]	/* input of size n, not modified */
)
{
    int j ;
    for (j = 0 ; j < n ; j++){ X [j] /= D [j]; }
}

void LDL_ltsolve
(
    int n,		/* L is n-by-n, where n >= 0 */
    DTYPE X [ ],	/* size n.  right-hand-side on input, soln. on output */
    int Lp [ ],	/* input of size n+1, not modified */
    int Li [ ],	/* input of size lnz=Lp[n], not modified */
    DTYPE Lx [ ]	/* input of size lnz=Lp[n], not modified */
)
{
    int j, p, p2 ;
    for (j = n-1 ; j >= 0 ; j--){
		p2 = Lp [j+1] ;
		for (p = Lp [j] ; p < p2 ; p++){
			X [j] -= Lx [p] * X [Li [p]] ;
		}
    }
}

void LDL_lsolve2
(
    int n,		/* L is n-by-n, where n >= 0 */
	DTYPE b [ ],	/* size n. input. right-hand-side */    
    int Lp [ ],	/* input of size n+1, not modified */
    int Li [ ],	/* input of size lnz=Lp[n], not modified */
    DTYPE Lx [ ],	/* input of size lnz=Lp[n], not modified */
	DTYPE x [ ]	/* size n. output. solution to Lx=b */
)
{
    int j, p, p2 ;
	for( j=0; j < n; j++ ){ x[j] = b[j]; }
    for (j = 0 ; j < n ; j++){		
		p2 = Lp [j+1] ;
		for (p = Lp [j] ; p < p2 ; p++){ 
			x [Li [p]] -= Lx [p] * x [j]; 
		}
    }
}

bool v_eq(DTYPE* x1, DTYPE* x2, int len) {
	for (auto i = 0; i < len; i++) {
		//printf("x1 %f, x2 %f\n", x1[i], x2[i]);
		if (abs(x1[i] - x2[i]) > 1e-6) {
			return false;
		}
	}
	return true;
}

